import {
    configureStore
} from '@reduxjs/toolkit'
import {
    pokemonAddSlice
} from './pokemonAddSlice'

const store = configureStore({
    reducer: {
        pokemonAddSlice: pokemonAddSlice.reducer
    }
})
export const pokemonAddActions = pokemonAddSlice.actions
export default store
